result:
.search-box
    display flex
    align-items center
    width 100%
    height 48px
    padding 10px 10px 10px 0
    cursor pointer;
    &.center{
        justify-content center;
    }
    &.right{
        justify-content right;
    }
    .title{
        margin-right 10px;
        font-size 15px;
    }
    .map{
        color #fff;
        font-size 15px
        margin-right 10px
        .iconfont{
            font-size 16px;
        }
        .iconxiayi{
            font-size 12px;
        }
    }
    img
        width 76px
        height 30px
        margin-right 10px
    .box
        flex 1
        height 30px
        line-height 30px
        color #999
        font-size 12px
        padding-left 10px
        background #fff
        border-radius:15px;
        .iconfont{
            margin-right 5px
            margin-top: -3px;
            display: inline-block;
            vertical-align: middle;
        }
        &.right{
            text-align right
            padding-right 10px
        }
        &.on
            border-radius 0
        &.center
            text-align center
            padding-left 0
